#define ZAKAROUF__ZTYPES_TYPES__TUPLE_H

#include "prep/base.h"
#include "prep/args.h"

/** Public **/

/* Creates a anonymous tuple */
#define z__TupleX(...)\
    struct {                                 \
        z__Tuple___createMember(__VA_ARGS__) \
    }

/* Creates a Tuple Type */
#define z__Tuple(Name, ...)\
    struct Name {  \
        z__Tuple___createMember(__VA_ARGS__) \
    }

/* Access A value from Tuple using indexing */
#define z__Tuple_get(tup, n) zpp__CAT(tup._, n)


/** Private **/
#define z__PRIV__Tuple__toVar__Apply_if_1(TupleName, x, variant)
#define z__PRIV__Tuple__toVar__Apply_if_0(TupleName, x, variant)\
    z__typeof(zpp__CAT(TupleName._, x)) variant

#define z__PRIV__Tuple__toVar__Apply_if(TupleName, x, variant)\
    zpp__CAT(z__PRIV__Tuple__toVar__Apply_if_, zpp__IS_PAREN(variant))(TupleName, x, variant)


#define z__PRIV__Tuple__toVar_Empty_1(TupleName, ...) zpp__IGNORE(__VA_ARGS__)
#define z__PRIV__Tuple__toVar_Empty_0(TupleName, ...)\
    zpp__CAT(z__PRIV__Tuple__toVar__, zpp__PRIV__DEC(zpp__Args_Count(__VA_ARGS__)) )(TupleName, 0, __VA_ARGS__)

#define z__PRIV__Tuple__toVar(TupleName, ...)\
    zpp__CAT(z__PRIV__Tuple__toVar_Empty_, zpp__Args_IS_EMPTY(__VA_ARGS__))(TupleName, __VA_ARGS__)

#define z__Tuple_toVarProto(TupleName, ...)  z__PRIV__Tuple__toVar(TupleName, __VA_ARGS__)

/* Create Members of Tuple */
#define z__PRIV__Tuple__createMember(...) zpp__CAT(z__PRIV__Tuple__createMember_, zpp__Args_Count(__VA_ARGS__))(0 ,__VA_ARGS__)
#define z__Tuple___createMember(...) z__PRIV__Tuple__createMember(__VA_ARGS__)

/* Creates List of Members of Tuple */
#define z__PRIV__Tuple__createMemberList(...) zpp__CAT(z__PRIV__Tuple__createMemberList_, zpp__Args_Count(__VA_ARGS__))(0 ,__VA_ARGS__)
#define z__Tuple___createMemberList(...) z__PRIV__Tuple__createMemberList(__VA_ARGS__)

/* Create References to Tuple */
#define z__PRIV__Tuple__toReference__Apply_if_1(TupleName, x, variant)

#define z__PRIV__Tuple__toReference__Apply_if_0(TupleName, x, variant)\
    z__typeof(zpp__CAT(TupleName._, x)) *variant = &zpp__CAT(TupleName._, x)

#define z__PRIV__Tuple__toReference__Apply_if(TupleName, x, variant)\
    zpp__CAT(z__PRIV__Tuple__toReference__Apply_if_, zpp__IS_PAREN(variant))(TupleName, x, variant)

#define z__PRIV__Tuple__toReference_Empty_1(TupleName, ...) zpp__IGNORE(__VA_ARGS__)
#define z__PRIV__Tuple__toReference_Empty_0(TupleName, ...)\
    zpp__CAT(z__PRIV__Tuple__toReference__, zpp__PRIV__DEC(zpp__Args_Count(__VA_ARGS__)) )(TupleName, 0, __VA_ARGS__)
    
#define z__PRIV__Tuple__toReference(TupleName, ...)\
    zpp__CAT(z__PRIV__Tuple__toReference_Empty_, zpp__Args_IS_EMPTY(__VA_ARGS__))(TupleName, __VA_ARGS__)

#define z__Tuple_toReference(TupleName, ...)  z__PRIV__Tuple__toReference(TupleName, __VA_ARGS__)


/* Assingment Of Tuple */
#define z__PRIV__Tuple__assign(TupleName, ...) zpp__CAT(z__PRIV__Tuple__assign__, zpp__PRIV__DEC(zpp__Args_Count(__VA_ARGS__)))(TupleName, 0, __VA_ARGS__)
#define z__Tuple_assign(TupleName, ...) z__PRIV__Tuple__assign(TupleName, __VA_ARGS__)


